import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import {withRouter} from 'react-router-dom';
import axios from 'axios';
// import $ from 'jquery';

import '../components/style/style.css'
import logo from "../img/logo.png"
import Popup from '../components/popuplogin';


function Encomendas({userData}){
    //const history = useNavigate();
    const navigate = useNavigate();
    
    const[formData, setEncomendas] = useState({
            id: 0,
            cdprod: 0,
            datapedido: '24-01-2024',
            quantidade: 0,
            valor: 0,
            status: ' ',
            solicitante: 'FuncionÃ¡rio 1',
            fornecedorCNPJ: 'XXXXXX/XXXX'
        
    });

    const sendEncomendas = (data) => {
        setEncomendas(data);
    }

    
    const handleInputChange = (event) => {
        const { name, value } = event.target;
        setEncomendas((prevData) => ({
          ...prevData,
          [name]: value,
        }));
    };
    /*
    function createEncomenda(input){
      var jqXHR = $.ajax({
          type: "POST",
          url: "/api/createEncomenda",
          async: false,
          data: { data: input}
      });
  
      return jqXHR.responseText;
      // return jqXHR;
  }

  function returnEncomendas(input){
    var data = $.ajax({
        type: "POST",
        url: "/api/returnEncomenda",
        async: false,
        data: { data: input}
    });

    sendEncomendas(data);
  }
  */

  const handleSubmit = (event) => {
      event.preventDefault();
      
      /*axios.post('http://127.0.0.1:5000/api/sendDados', formData)
        .then(response => {
          console.log('Resposta do servidor:', response.data);
        })
        .catch(error => {
          console.error('Erro ao enviar dados:', error);
        });*/
    };
  

    return (
        <div className="mform">
        <div class = "text">Encomendas</div>
        <form onSubmit={handleSubmit}>
           
            <div className='form-all'>
              <div class = "text">
                Criar Encomenda
              </div>
              <div class="form-row">
              <div class="input-data">
                <input 
                        name="id" 
                        className='dadosEncomenda' 
                        value={formData.id}
                        onChange={handleInputChange} required/>
                        <div class="underline"></div>
                    <label for="id">
                    ID
                    </label>
              </div>
              <div class="input-data">
                <input 
                        name="solicitante" 
                        className='dadosEncomenda' 
                        value={formData.solicitante}
                        onChange={handleInputChange} required/>
                        <div class="underline"></div>
                    <label for="solicitante">
                    Nome Solicitante
                    </label>
              </div>
                
                <div class = "input-data">
                  <input 
                        name="fornecedorCNPJ" 
                        className='dadosEncomenda' 
                        value={formData.fornecedorCNPJ}
                        onChange={handleInputChange} required />
                  <div class="underline"></div>
                <label for="fornecedorCNPJ">
                    CNPJ Fornecedor  
                </label>     
                </div>
                
              </div>
              
              <div className="form-row">
              <div class="input-data">
                  <input 
                        name="cdprod" 
                        className='dadosEncomenda' 
                        value={formData.cdprod}
                        onChange={handleInputChange} required/>
                  <div class="underline"></div>
                <label for="cdprod">
                    CÃ³digo do Produto
                    
                </label>    
                </div>
              <div class = "input-data">
                  <input 
                        name="quantidade" 
                        className='dadosEncomenda' 
                        value={formData.quantidade}
                        onChange={handleInputChange} required />
                  <div class="underline"></div>
                <label for="quantidade">
                    Quantidade do Produto 
                </label>     
                </div>
                <div class="input-data">
                  <input 
                        name="valor" 
                        className='dadosEncomenda' 
                        value={formData.valor}
                        onChange={handleInputChange} required/>
                  <div class="underline"></div>
                <label for="valor">
                    Valor Total
                </label>    
                </div>
                <div class="input-data">
                  <input 
                        name="datapedido" 
                        className='dadosEncomenda' 
                        value={formData.datapedido}
                        onChange={handleInputChange} required/>
                  <div class="underline"></div>
                <label for="datapedido">
                    Data do Pedido
                </label>    
                </div>
              </div>
              
                <div class="form-row submit-btn">
                  <div class="input-data">
                    <div class="inner"></div>
                      <input type="submit" value="submit"/>

                  </div>
                </div>
                
                
            </div>
        </form>
        <div className='encomendasFeitas'>
          <div class = "text">Encomendas Feitas</div>
        </div>
      </div>
        
        
  );
}

export default Encomendas;
